Orangutan Diary: Series 2

Nature Documentary hosted by Michaela Strachan and Steve Leonard, published by BBC in 2010 - English narration


Information
------------------------------

Orangutan Diaries: Series 2
Prepare for a rollercoaster ride of emotions following the life and death struggle to save irresistibly cute Orangutan orphans in Borneo. Two years after their inspirational and moving visit to the Borneo Orangutan Foundation, Steve Leonard and Michaela Strachan return to catch up on the progress of the rescued orangutans, meet some of the fragile new arrivals and discover how the fight against extinction is progressing. Deep in the Borneo rainforest, the dedicated vets and carers of the Foundation care for over 600 orangutans. With vulnerable babies in the nursery needing 24-hour care, playful orphans in the Forest School learning the skills they need in the wild, and older primates becoming ready for release, the team do everything they can to save the species from extinction. This inspirational series captures the drama and emotion of the Foundation as they work to save a magnificent creature on the verge of extinction. 
Orangutan Diary Series Two is a uniquely intimate look at the most engaging of the great apes, in one of the remotest corners of the world.




6)  Part 6 
Steve Leonard and Michaela Strachan catch up with some of the orangutans and people who've made their time at the world's biggest ape rescue operation such a rich experience. There have been dramatic rescues, loveable orphans with tragic stories and the emotional release of orangutans back to the wild. We reflect on the work of the centre and the long-term fate of over 600 rescued orangutans in its care. Can some of our closest animal relatives be saved from extinction?



